import Link from 'next/link';
import { useRouter } from 'next/router';
import Nav from './Nav';

const Header = () => {
  return (
    <React.Fragment>
      <Link href="/">
        <a>
          <img src="/grocery-bags.png" alt="Image of Grocery Bags" />
        </a>
      </Link>
      <Nav />
    </React.Fragment>
  );
};

export default Header;
